/* === inject unique design for hero card (append at end of bundle) === */
(()=>{function onReady(fn){if(document.readyState!=="loading")fn();else document.addEventListener("DOMContentLoaded",fn)}
function pickCard(){
  // trova elementi che contengono tutti i frammenti chiave della classe
  const parts=["p-6","w-full","flex","lg:bg-plane","dark:lg:bg-plane-light","bg-no-repeat","bg-[right_200px_top_-55px]"];
  const all = Array.from(document.querySelectorAll("div,section,article"));
  return all.find(el=>{
    const c = (el.getAttribute("class")||"");
    return parts.every(p=>c.includes(p));
  })||null;
}
function injectCSS(){
  if(document.getElementById("custom-neo-card-css")) return;
  const css = `
  @keyframes shimmerAngle{0%{transform:rotate(0deg)}100%{transform:rotate(360deg)}}
  .custom-neo-card{
    position:relative;
    isolation:isolate;
    border-radius:20px;
    overflow:hidden;
    backdrop-filter:saturate(140%) blur(8px);
    box-shadow:0 12px 40px rgba(0,0,0,.35);
  }
  .custom-neo-card::before{
    content:"";
    position:absolute; inset:-1px;
    border-radius:22px;
    background:conic-gradient(from 180deg at 50% 50%, #8cf8ff, #a98bff, #ff7fd1, #8cf8ff);
    z-index:-2;
    filter:blur(.6px);
    animation:shimmerAngle 14s linear infinite;
    opacity:.9;
  }
  .custom-neo-card::after{
    content:"";
    position:absolute; inset:1.5px;
    border-radius:18px;
    background:linear-gradient(180deg, rgba(255,255,255,.06), rgba(255,255,255,.02));
    z-index:-1;
    border:1px solid rgba(255,255,255,.06);
  }
  /* micro pattern in alto a destra per renderla unica */
  .custom-neo-card .neo-sheen{position:absolute; right:-60px; top:-60px; width:240px; height:240px; border-radius:50%;
    background:
      radial-gradient(closest-side, rgba(140,248,255,.22), transparent 70%),
      radial-gradient(closest-side, rgba(255,127,209,.18), transparent 70%);
    filter:blur(20px); pointer-events:none;
  }
  .custom-neo-card:hover{transform:translateY(-2px); transition:transform .18s ease, box-shadow .18s ease; box-shadow:0 16px 46px rgba(0,0,0,.42)}
  /* bordo interno leggero */
  .custom-neo-card > *{position:relative}
  `;
  const style=document.createElement("style");
  style.id="custom-neo-card-css";
  style.textContent=css;
  document.head.appendChild(style);
}
function decorate(){
  const card = pickCard();
  if(!card) return;
  if(!card.classList.contains("custom-neo-card")){
    card.classList.add("custom-neo-card");
    const sheen = document.createElement("div");
    sheen.className="neo-sheen";
    card.appendChild(sheen);
  }
}
onReady(()=>{injectCSS(); decorate();
  // per SPA/navigazioni interne/refresh dinamici
  const mo = new MutationObserver(()=>{decorate()});
  mo.observe(document.body,{childList:true,subtree:true});
});
})();
/* === patch: rimuovi bordo/ombra/plane originali dalla card target === */
(()=>{function onReady(f){if(document.readyState!=="loading")f();else document.addEventListener("DOMContentLoaded",f)}
function pickCard(){
  const parts=["p-6","w-full","flex","lg:bg-plane","dark:lg:bg-plane-light","bg-no-repeat","bg-[right_200px_top_-55px]"];
  const all = Array.from(document.querySelectorAll("div,section,article"));
  return all.find(el=>parts.every(p=>(el.getAttribute("class")||"").includes(p)))||null;
}
function stripOldStyles(card){
  if(!card) return;
  // 1) Rimuovi classi che applicano background/board/ring/shadow
  const toRemove = ["lg:bg-plane","dark:lg:bg-plane-light","bg-no-repeat","bg-[right_200px_top_-55px]"];
  const startsWith = ["border","ring","shadow"];
  card.className = card.className
    .split(/\s+/)
    .filter(c=>!toRemove.includes(c) && !startsWith.some(p=>c.startsWith(p)))
    .join(" ");

  // 2) Resetta direttamente gli stili del wrapper
  Object.assign(card.style,{
    background:"transparent",
    backgroundImage:"none",
    border:"0",
    outline:"0",
    boxShadow:"none"
  });

  // 3) Kill rings/shadows tailwind (var-based) + border-color
  card.style.setProperty("--tw-ring-offset-shadow","0 0 #0000");
  card.style.setProperty("--tw-ring-shadow","0 0 #0000");
  card.style.setProperty("--tw-shadow","0 0 #0000");

  // 4) Resetta eventuali figli con border/ring/shadow visibili ai bordi
  card.querySelectorAll("*").forEach(n=>{
    const cls = n.className || "";
    if(typeof cls==="string" && (/(\b(border|ring|shadow)(-|$))/).test(cls)){
      n.style.border="0";
      n.style.boxShadow="none";
      n.style.setProperty("--tw-ring-offset-shadow","0 0 #0000");
      n.style.setProperty("--tw-ring-shadow","0 0 #0000");
      n.style.setProperty("--tw-shadow","0 0 #0000");
    }
  });

  // 5) Aggiungi/ri-forza la nostra skin (se usi lo snippet precedente)
  card.classList.add("custom-neo-card");
}
function addOverrideCSS(){
  if(document.getElementById("neo-card-reset-css")) return;
  const style=document.createElement("style");
  style.id="neo-card-reset-css";
  style.textContent = `
    /* forza override su utilità tailwind preesistenti */
    .custom-neo-card{
      background:transparent !important;
      background-image:none !important;
      border:0 !important;
      outline:0 !important;
      --tw-ring-offset-shadow:0 0 #0000 !important;
      --tw-ring-shadow:0 0 #0000 !important;
      --tw-shadow:0 0 #0000 !important;
      box-shadow:0 12px 40px rgba(0,0,0,.35) !important; /* nostra ombra */
      border-radius:20px !important;
      overflow:hidden !important;
      isolation:isolate;
    }
  `;
  document.head.appendChild(style);
}
onReady(()=> {
  addOverrideCSS();
  const card = pickCard();
  stripOldStyles(card);
  // osserva cambi nel DOM (navigazione SPA)
  const mo = new MutationObserver(()=>{ const c=pickCard(); stripOldStyles(c); });
  mo.observe(document.body,{childList:true,subtree:true});
});
})();
